import React, { useState } from "react";


const App = () => {

  const [curTime, setCurTime] = useState(new Date().getHours());
  const setTime = () => {
      curTime = new Date().getTime()
      setCurTime(curTime);
  }
  return (
  <>
    <h1> {curTime} </h1>
    <button onClick={setTime}> Click Me </button>
  </>
  );
};

export default App;
